INSERT INTO `officeoasis`.`product` (`id`, `average_rating`, `category`, `description`, `discount`, `name`, `price`) VALUES
('1', '1.2', '1', 'La cartuccia toner Brother TN2420 è progettata per garantire stampe di alta qualità su stampanti Brother. Con questa cartuccia, otterrai risultati nitidi e duraturi per soddisfare le tue esigenze di stampa quotidiane.', '12', 'Brother TN2420', '32.99'),
('2', '3.3', '1', 'La cartuccia toner originale Brother TN2320 offre una capacità elevata per un\'eccellente produttività di stampa. Con questa cartuccia, puoi stampare documenti di alta qualità in modo affidabile e continuativo.', '45', 'Brother TN2320', '70'),
('3', '4.5', '1', 'La cartuccia toner Brother TN1050 è compatibile con una vasta gamma di stampanti Brother. Offre stampe nitide e chiare per documenti professionali e presentazioni di alta qualità.', '20', 'Brother TN1050', '75'),
('4', '1.1', '1', 'La cartuccia toner Brother TN3480 è progettata per garantire stampe di alta qualità su una varietà di supporti. Questa cartuccia offre prestazioni affidabili e costanti per soddisfare le tue esigenze di stampa quotidiane.', '100', 'Brother TN3480', '76'),
('5', '3.4', '1', 'La cartuccia toner Brother TN2220 offre un\'eccellente qualità di stampa e una lunga durata. Con questa cartuccia, otterrai stampe nitide e uniformi per una vasta gamma di documenti e progetti.', '5', 'Brother TN2220', '56'),
('6', '2.4', '1', 'Il set Brother TN247 BK,C,M,Y include cartucce toner nero, ciano, magenta e giallo. Questo set offre stampe di alta qualità e una maggiore resa per soddisfare le esigenze di stampa di qualsiasi ufficio o ambiente di lavoro.', '12', 'Brother TN247 BK,C,M,Y', '756'),
('7', '5', '1', 'Il bundle Brother TN241BK, TN245 C,M,Y include cartucce toner nero, ciano, magenta e giallo. Questo bundle offre stampe di alta qualità e colori vibranti per una varietà di progetti di stampa.', '9', 'Brother TN241BK, TN245 C,M,Y', '556'),
('8', '4.2', '1', 'La cartuccia toner Samsung MLT-D111L offre stampe nitide e chiare per una vasta gamma di documenti. Questa cartuccia è progettata per garantire prestazioni affidabili e una lunga durata.', '29', 'Samsung MLT-D111L', '100'),
('9', '3.2', '1', 'La cartuccia toner Samsung MLT-D116 offre una capacità elevata e stampe di alta qualità per soddisfare le esigenze di stampa professionali. Questa cartuccia è ideale per uffici e ambienti di lavoro impegnativi.', '52', 'Samsung MLT-D116', '110'),
('10', '2.2', '1', 'La cartuccia toner Samsung MLT-D101 offre una resa elevata e stampe nitide per una varietà di documenti e progetti. Questa cartuccia è progettata per garantire prestazioni affidabili e uniformi.', '3', 'Samsung MLT-D101', '145'),
('11', '1.9', '1', 'La cartuccia toner Samsung ML1660/1042 offre stampe di alta qualità e una lunga durata. Questa cartuccia è ideale per le esigenze di stampa quotidiane in uffici e ambienti domestici.', '16.53', 'Samsung ML1660/1042', '76'),
('12', '2.6', '1', 'La cartuccia toner Samsung ML1910/1052 offre stampe nitide e uniformi per una vasta gamma di documenti e progetti. Con questa cartuccia, otterrai risultati di stampa professionali e affidabili.', '5', 'Samsung ML1910/1052', '126'),
('13', '3.3', '1', 'La cartuccia toner Samsung MLT-D203L offre una capacità elevata e stampe di alta qualità per soddisfare le esigenze di stampa impegnative. Questa cartuccia è ideale per uffici e ambienti di lavoro dinamici.', '5', 'Samsung MLT-D203L', '156'),
('14', '2.6', '1', 'La cartuccia toner Samsung MLT-D205L offre una resa elevata e stampe nitide per una vasta gamma di documenti e progetti. Questa cartuccia è progettata per garantire risultati di stampa professionali e consistenti.', '5', 'Samsung MLT-D205L', '156'),
('15', '1.7', '1', 'Il toner HP CB435-436 CE285/ Canon 712 713 725 offre stampe di alta qualità e una lunga durata. Questa cartuccia è ideale per la stampa di documenti aziendali, presentazioni e altro ancora.', '999999999', 'HP CB435-436 CE285/ Canon 712 713 725 ', '500'),
('16', '4.4', '1', 'Il toner HP CE278/Canon 728/726 offre stampe nitide e uniformi per una vasta gamma di documenti e progetti. Con questa cartuccia, otterrai risultati di stampa professionali e affidabili.', '99.99', 'HP CE278/Canon 728/726', '70'),
('17', '2.6', '1', 'Il toner HP CE505/Canon CF280 offre una capacità elevata e stampe di alta qualità per soddisfare le esigenze di stampa impegnative. Questa cartuccia è ideale per uffici e ambienti di lavoro dinamici.', '100', 'HP CE505/Canon CF280', '75'),
('18', '2.3', '1', 'Il toner HP CF244A offre stampe nitide e uniformi per una vasta gamma di documenti e progetti. Con questa cartuccia, otterrai risultati di stampa professionali e consistenti.', '5', 'HP CF244A', '76'),
('19', '1.1', '1', 'Il toner HP W1106 con chip offre una capacità elevata e stampe di alta qualità per soddisfare le esigenze di stampa quotidiane. Questa cartuccia è compatibile con una varietà di stampanti HP.', '5', 'HP W1106 con chip', '56'),
('20', '3.3', '1', 'Il set HP CB540-41-42-43 (BK+ colori) include cartucce toner nero, ciano, magenta e giallo. Questo set offre stampe di alta qualità e colori vibranti per una varietà di progetti di stampa.', '5', 'HP CB540-41-42-43 (BK+ colori)', '756'),
('21', '4.4', '1', 'Il bundle HP 117A BK,C,M,Y include cartucce toner nero, ciano, magenta e giallo. Questo bundle offre stampe di alta qualità e colori vibranti per una varietà di progetti di stampa.', '100', 'HP 117A BK,C,M,Y', '556');
